import React from 'react'
import { GetUsers } from '../DataCollection/Request'
import { useEffect } from 'react';

export const RenderMeeting = (props) => {
  var x = [];
  useEffect(() => {
    console.log(x)
  },x)
  GetUsers().then((res) => {
     return res.map((data) => {x.push(data)});
  });

  timer = setTimeout(() => {
  }, 5000);
  clearTimeout(timer);

 

  x.map((data) => {
    console.log(data)
  })
 

  /* return (
